import React from "react";

import styles from "./Button.css";

const Button = ({ buttonText, onClick }) => {
  return (
    (buttonText = "biba"),
    (
      <button className={styles.button} onClick={onClick}>
        {buttonText}
      </button>
    )
  );
};

export default Button;
